"""
EBICS client module of the Python FinTech package.

This module defines functions and classes to work with EBICS.
"""

__all__ = ['EbicsKeyRing', 'EbicsBank', 'EbicsUser', 'BusinessTransactionFormat', 'EbicsClient', 'EbicsVerificationError', 'EbicsTechnicalError', 'EbicsFunctionalError', 'EbicsNoDataAvailable']

class EbicsKeyRing:
    """
    EBICS key ring representation

    An ``EbicsKeyRing`` instance can hold sets of private user keys
    and/or public bank keys. Private user keys are always stored AES
    encrypted by the specified passphrase (derivated by PBKDF2). For
    each key file on disk or same key dictionary a singleton instance
    is created.
    """

    def __init__(self, keys, passphrase=None, sig_passphrase=None):
        """
        Initializes the EBICS key ring instance.

        :param keys: The path to a key file or a dictionary of keys.
            If *keys* is a path and the key file does not exist, it
            will be created as soon as keys are added. If *keys* is a
            dictionary, all changes are applied to this dictionary and
            the caller is responsible to store the modifications. Key
            files from previous PyEBICS versions are automatically
            converted to a new format.
        :param passphrase: The passphrase by which all private keys
            are encrypted/decrypted.
        :param sig_passphrase: A different passphrase for the signature
            key (optional). Useful if you want to store the passphrase
            to automate downloads while preventing uploads without user
            interaction. (*New since v7.3*)
        """
        ...

    @property
    def keyfile(self):
        """The path to the key file (read-only)."""
        ...

    def set_pbkdf_iterations(self, iterations=10000, duration=None):
        """
        Sets the number of iterations which is used to derivate the
        passphrase by the PBKDF2 algorithm. The optimal number depends
        on the performance of the underlying system and the use case.

        :param iterations: The minimum number of iterations to set.
        :param duration: The target run time in seconds to perform
            the derivation function. A higher value results in a
            higher number of iterations.
        :returns: The specified or calculated number of iterations,
            whatever is higher.
        """
        ...

    @property
    def pbkdf_iterations(self):
        """
        The number of iterations to derivate the passphrase by
        the PBKDF2 algorithm. Initially it is set to a number that
        requires an approximate run time of 50 ms to perform the
        derivation function.
        """
        ...

    def save(self, path=None):
        """
        Saves all keys to the file specified by *path*. Usually it is
        not necessary to call this method, since most modifications
        are stored automatically.

        :param path: The path of the key file. If *path* is not
            specified, the path of the current key file is used.
        """
        ...

    def change_passphrase(self, passphrase=None, sig_passphrase=None):
        """
        Changes the passphrase by which all private keys are encrypted.
        If a passphrase is omitted, it is left unchanged. The key ring is
        automatically updated and saved.

        :param passphrase: The new passphrase.
        :param sig_passphrase: The new signature passphrase. (*New since v7.3*)
        """
        ...


